    // MARK: - Public variables
    var icon = CALayer() {
        didSet {
            if icon is CAShapeLayer {
                (icon as! CAShapeLayer).frame = bounds
                (icon as! CAShapeLayer).fillColor = iconColor.cgColor
            }
            if oldValue != icon {
                oldValue.removeFromSuperlayer()
                layer.addSublayer(icon)
            }
        }
    }
    var isRounded = false {
        didSet {
            cornerRadius = isRounded ? bounds.width / 2 : 0
            layer.masksToBounds = isRounded ? true : false
        }
    }
    var iconColor: UIColor = .white
    var category: Category = .Null {
        didSet {
//            if category != oldValue {
                //                setupLayerFrames()
                icon = getLayer()
//            }
        }
    }
    var text = "" {
        didSet {
            if oldValue != text, category == .Text {
                icon = getLayer()
            }
        }
    }
    var textSize: CGFloat = 43
    var scaleMultiplicator: CGFloat = .zero {
        didSet {
            guard oldValue != scaleMultiplicator else { return }
            icon = getLayer()
        }
    }
    
    
    
