    // MARK: - Public methods
    public func replicate() -> Icon {
        let instance = Icon()
        instance.frame = frame
        instance.scaleMultiplicator = scaleMultiplicator
        instance.isRounded = isRounded
        instance.backgroundColor = backgroundColor
        instance.iconColor = iconColor
        instance.tintColor = tintColor
        instance.category = category
        
        return instance
    }
    
    public func setIconColor(_ _color: UIColor) {
        if icon is CAShapeLayer {
            (icon as! CAShapeLayer).fillColor = _color.cgColor
            iconColor = _color
        }
    }
    
